import React from "react";
import ReactDOM from "react-dom";

const name="Dinsha Jaiswal";
const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/300/300";
const img3="https://picsum.photos/400/300";
const img4="https://picsum.photos/500/300";
const img5="https://picsum.photos/1000/500";
const links="www.google.com";
ReactDOM.render(
  [<h1 contentEditable="true">My name is {name}</h1>,
    <img src={img1} alt=" not found!!"/>,
    <img src={img2} alt=" not found!!"/>,
    <img src={img3} alt=" not found!!"/>,
    <img src={img4} alt=" not found!!"/>,
    <a href={links}><img src={img5} alt=" not found!!"/></a>
],document.getElementById("root")

);
